import React from 'react'
import ReactDOM from 'react-dom'

const TodoList = () => {
    const items = [
        'Todo first',
        'Todo second',
        'Todo third',
    ]

    return (
        <ul>
            <li>Todo first</li>
            <li>Todo second</li>
        </ul>

    )
}

const AppHeader = () => {
    return (
        <h1>Todo List</h1>
    )
}

const SearchPanel = () => {
    return <input placeholder="search" />
}

const App = () => {
    return (
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    )
}

ReactDOM.render(<App/>, document.getElementById('root'))
